import React from "react";

function Header() {
  return (
    <header className="flex flex-col relative w-full bg-gray-500 py-4 justify-items-center items-center ">
      <div>
        <h1 className="text-8xl text-red-400">Pink World</h1>
      </div>
    </header>
  );
}

export default Header;
